INSERT INTO `books` (`author`, `title`, `isbn`, `description`, `img`, `id`) VALUES
('Ryszard Kapuscinski', 'Encuentro con el Otro', 97802948, 'El concepto de «el Otro» puede entenderse como el individuo que se contrapone a los demás individuos, pero «el Otro» también es aquel que hunde sus raíces en la diversidad de sexo, generación, nacionalidad y religión. A través del reportaje, el autor rememora a los interlocutores que ha ido encontrando por las calles del mundo. Son personas hechas de dos partes: una es el hombre con sus alegrías y sus penas, y la otra es la identidad racial, cultural y religiosa.', , 1);
INSERT INTO `books` (`author`, `title`, `isbn`, `description`, `img`, `id`) VALUES
('Franz Kafka', 'El Proceso', 98302948, 'Una mañana cualquiera, Josef K., joven empleado de un banco, se despierta en la pensión donde reside con la extraña visita de unos hombres que le comunican que está detenido -aunque por el momento seguirá libre-. Le informan de que se ha iniciado un proceso contra él, y le aseguran que conocerá los cargos a su debido tiempo.', , 2);
INSERT INTO `books` (`author`, `title`, `isbn`, `description`, `img`, `id`) VALUES
('Brooke Barker', 'Sad Animal Facts', 2147483647, 'A delightful and quirky compendium of the Animal Kingdom’s more unfortunate truths, with over 150 hand-drawn illustrations. This melancholy menagerie pairs the more unsavory facts of animal life with their hilarious thoughts and reactions. Sneakily informative, and wildly witty, SAD ANIMAL FACTS will have you crying with laughter.', , 3);
INSERT INTO `books` (`author`, `title`, `isbn`, `description`, `img`, `id`) VALUES
('Brené Brown', 'A Coragem de Ser Imperfeito', 939883647, 'Brené Brown ousou tocar em assuntos que costumam ser evitados por causarem grande desconforto. Sua palestra a respeito de vulnerabilidade, medo, vergonha e imperfeição já teve mais de 25 milhões de visualizações. Viver é experimentar incertezas, riscos e se expor emocionalmente. Mas isso não precisa ser ruim. Como mostra Brené Brown, a vulnerabilidade não é uma medida de fraqueza, mas a melhor definição de coragem. ', , 4);
INSERT INTO `books` (`author`, `title`, `isbn`, `description`, `img`, `id`) VALUES
('Julia Cameron', 'El Camino Del Artista:', 836648223, 'El camino del artista nos enseña a crear con mayor libertad a través de la utilización consciente de una serie de herramientas que nos ayudarán a terminar con el bloqueo creativo. Su efecto es similar al yoga y la práctica constante de la escritura diaria -páginas matutinas-, los encuentros con el artista, el juego y una exhaustiva introspección guiada harán que modifiquemos nuestra conciencia y nos abramos a un nuevo horizonte imaginativo. ', , 5);
INSERT INTO `books` (`author`, `title`, `isbn`, `description`, `img`, `id`) VALUES
('María Hesse', 'Frida Kahlo', 908374390, 'Una preciosa biografía de la pintora mexicana Frida Kahlo ilustrada con las evocadoras imágenes de María Hesse, ganadora del Premio de la Fundación Nacional del Libro Infantil y Juvenil de Brasil. Inspirado en las vivencias de la icónica pintora mexicana, este libro ofrece un hermoso paseo ilustrado por su vida y su obra.', , 6);

